                    </div>
                </div>

                </div>

                <div className="Song-Name-and-Artist">
                <img src="https://uploads-ssl.webflow.com/5e36ddfda3d85b56ce206efc/5e374b80a3d85b6ff824af5e_3dots.png" className='pr2' alt=""/>
                <div>4:12</div>
                </div>

        </div>


    </div>

        
  
    );

    

}
    
